import React, { Component } from 'react'
import ReactDOM from 'react-dom'
import render from 'react-dom';
// import logo from './logo.svg';
import './App.css';
import PDFViewer from 'pdf-viewer-reactjs';

const ExamplePDFViewer = () => {
  return (
    <PDFViewer
      document={{
        url: '../public/BradKaesResume.pdf'
      }}
      />
  )
}
export default class App extends Component {
  render() {
    return (
      <html>
        <header>
          <div id="top">
           <h1>
            Kelly McNutt Is Lovely
            </h1>
            <p>
            Her cats are her second best quality.
            </p>
          </div>
          <ExamplePDFViewer />
          </header>
        <body>

        </body>
        <footer> 
        Bottom Nav
        </footer>
      </html>
    );
  }
}
